    def cutOffTree(self, forest):
        """
        :type forest: List[List[int]]
        :rtype: int
        """

        # find the starting point
        m, n = len(forest), len(forest[0])
        trees = [(forest[i][j], i, j) for i in range(m) for j in range(n) if forest[i][j] > 1]
        if not trees:
            return -1
        trees.sort(key=lambda x: x[0])
        sx, sy = trees[0][1], trees[0][2]
        res = 0
        for h, x, y in trees[1:]:
            d = self.bfs(forest, sx, sy, x, y)
            if not d:
                return -1
            res += d
            sx, sy = x, y
        return res

    def bfs(self, forest, sx, sy, tx, ty):
        m, n = len(forest), len(forest[0])
        q = [(sx, sy)]
        seen = {(sx, sy)}
        step = 0
        while q:
            nq = []
            for x, y in q:
                if x == tx and y == ty:
                    return step
                for nx, ny in ((x, y-1), (x, y+1), (x-1, y), (x+1, y)):
                    if 0 <= nx < m and 0 <= ny < n and forest[nx][ny] > 1:
                        nq.append((nx, ny))
                        seen.add((nx, ny))
            q = nq
            step += 1
        return -1

