class Solution(object):
    def swimInWater(self, grid):
        """
        :type grid: List[List[int]]
        :rtype: int
        """

        n = len(grid)
        if n == 1:
            return grid[0][0]

        # Binary search for the answer
        lo, hi = grid[0][0], n * n - 1
        while lo < hi:
            mid = (lo + hi) / 2
            if self.is_possible(grid, mid, n):
                hi = mid
            else:
                lo = mid + 1
        return lo

    def is_possible(self, grid, t, n):
        q = collections.deque([(0, 0)])
        seen = set([(0, 0)])
        while q:
            x, y = q.popleft()
            if grid[x][y] <= t:
                return True
            for nx, ny in ((x - 1, y), (x + 1, y), (x, y - 1), (x, y + 1)):
                if 0 <= nx < n and 0 <= ny < n and (nx, ny) not in seen:
                    q.append((nx, ny))
                    seen.add((nx, ny))
        return False

