        :type beginWord: str
        :type endWord: str
        :type wordList: List[str]
        :rtype: List[List[str]]
        """

        # build the graph
        graph = collections.defaultdict(list)
        for word in wordList:
            graph[word].append(word)
            graph[word].append(word[:-1])
            graph[word].append(word[1:])

        # build the distance map
        dist = {beginWord: 1}
        q = collections.deque([beginWord])
        for word in graph[beginWord]:
            if word in graph:
                dist[word] = 2
                q.append(word)

        # BFS
        while q:
            word = q.popleft()
            if word == endWord:
                break
            for word in graph[word]:
                if word in dist:
                    dist[word] = dist[word] + 1
                    q.append(word)

        # build the result
        if endWord not in dist:
            return []
        res = [[endWord]]
        if endWord in dist:
            res.append([endWord])

        # build the parents map
        parents = {endWord: beginWord}
        while endWord in dist:
            for word in graph[endWord]:
                if word in dist:
                    parents[word] = endWord
                    if word not in res[dist[word] - 1]:
                        res.append([word] + res[dist[word] - 1])

